import React,{useState} from 'react';
import reactdom from 'react-dom';
let user=[];
const App=()=>{
    let [user,setUser]=useState([{name:"Akhil",age:80}]);
    const adduser = ()=> {
        setUser([...user,{name:"boss",age:90}]);
        console.log(...user);
    }
    return (
        <div>
        {
            user.map((here)=>{
                return (
                    <div> {here.name} </div>
                );
            })
        }
        <button onClick={adduser}> ADD USER  </button>
        </div>
    );
}

reactdom.render(<App/>,document.querySelector("#root"));
